// src/features/loans/CreateLoan.jsx
import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import './CreateLoan.css';

const CreateLoan = () => {
  const navigate = useNavigate();

  const [formData, setFormData] = useState({
    amount: '',
    duration: '',
    interestRate: '',
    purpose: '',
  });

  const [isSuperUser, setIsSuperUser] = useState(false);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchUserStatus = async () => {
      try {
        const res = await fetch('/api/users/profile', {
          headers: { Authorization: `Bearer ${localStorage.getItem('token')}` },
        });
        const data = await res.json();
        setIsSuperUser(data?.isSuperUser || false);
      } catch (err) {
        console.error('Failed to fetch user status', err);
      } finally {
        setLoading(false);
      }
    };
    fetchUserStatus();
  }, []);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const payload = {
      amount: parseFloat(formData.amount),
      duration: parseInt(formData.duration, 10),
      interestRate: parseFloat(formData.interestRate),
      purpose: (formData.purpose || '').trim(),
      isSuperUser,
    };

    try {
      const res = await fetch('/api/loans', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          Authorization: `Bearer ${localStorage.getItem('token')}`,
        },
        body: JSON.stringify(payload),
      });

      if (!res.ok) {
        const errorData = await res.json();
        throw new Error(errorData.error || 'Failed to create loan request');
      }

      const data = await res.json();
      console.log('Loan submitted:', data);
      alert('Loan request submitted successfully!');
      navigate('/dashboard');
    } catch (error) {
      console.error('Error submitting loan request:', error.message);
      alert(`There was a problem submitting your loan request: ${error.message}`);
    }
  };

  if (loading) return <div className="cl-container">Loading...</div>;

  return (
    <div className="cl-container">
      <h2 className="cl-title">Create a New Loan Request</h2>

      {/* SuperUser / fees note */}
      {isSuperUser ? (
        <div className="cl-note ok">
          üíé You‚Äôre a SuperUser ‚Äî the 3% PeerFund platform fee is waived on principal and payments. (A 3% banking fee still applies.)
        </div>
      ) : (
        <div className="cl-note warn">
          ‚ö†Ô∏è A 3% PeerFund platform fee applies to principal and payments. Upgrade to SuperUser to waive it.
          (A 3% banking fee still applies.)
        </div>
      )}

      <form className="cl-card" onSubmit={handleSubmit}>
        <div className="cl-grid">
          <div className="cl-field">
            <label>Loan Amount ($)</label>
            <input
              type="number"
              name="amount"
              value={formData.amount}
              onChange={handleInputChange}
              required
              min="0"
              max="250000"
              step="25"
              placeholder="e.g. 25, 50, 150"
            />
            <div className="cl-hint">Max $250,000 ‚Ä¢ increments of $50</div>
          </div>

          <div className="cl-field">
            <label>Duration (months)</label>
            <input
              type="number"
              name="duration"
              value={formData.duration}
              onChange={handleInputChange}
              required
              min="1"
              max="12"
              placeholder="1‚Äì12"
            />
          </div>

          <div className="cl-field">
            <label>Interest Rate (%)</label>
            <input
              type="number"
              name="interestRate"
              step="0.01"
              value={formData.interestRate}
              onChange={handleInputChange}
              required
              min="0"
              max="25"
              placeholder="e.g. 5, 10, 12.5"
            />
          </div>
        </div>

        <div className="cl-field" style={{ marginTop: 10 }}>
          <label>Purpose</label>
          <textarea
            name="purpose"
            value={formData.purpose}
            onChange={handleInputChange}
            placeholder="Tell lenders briefly why you need this loan‚Ä¶"
          />
        </div>

        <div className="cl-actions">
          <button type="button" className="action-btn" onClick={() => navigate(-1)}>
            ‚Üê Back
          </button>
          <button type="submit" className="action-btn primary">
            Post Loan Request
          </button>
        </div>
      </form>
    </div>
  );
};

export default CreateLoan;
